ivec3 get_facet(in int f) {
    return ivec3(
        get_data(MESH_DATA_OFFSET,3*f),
        get_data(MESH_DATA_OFFSET,3*f+1),
        get_data(MESH_DATA_OFFSET,3*f+2)
    );
}

const float FARAWAY=1e30;

struct Camera {
    vec3 Obs;
    vec3 View;
    vec3 Up;
    vec3 Horiz;
    float H;
    float W;
    float z;
};

struct Ray {
    vec3 Origin;
    vec3 Dir;
};

Camera camera(in vec3 Obs, in vec3 LookAt, in float aperture) {
   Camera C;
   C.Obs = Obs;
   C.View = normalize(LookAt - Obs);
   C.Horiz = normalize(cross(vec3(0.0, 0.0, 1.0), C.View));
   C.Up = cross(C.View, C.Horiz);
   C.W = float(iResolution.x);
   C.H = float(iResolution.y);
   C.z = (C.H/2.0) / tan((aperture * 3.1415 / 180.0) / 2.0);
   return C;
}

Ray launch(in Camera C, in vec2 XY) {
   return Ray(
      C.Obs,
      C.Obs+C.z*C.View+(XY.x-C.W/2.0)*C.Horiz+(XY.y-C.H/2.0)*C.Up 
   );
}

struct Intersection {
   float t;
   vec3 P;
   vec3 N;
   int id;
};

Intersection intersection() {
   Intersection I;
   I.t = FARAWAY;
   I.id = -1; // index of latest intersected triangle
   return I;
}

Ray reflect_ray(in Ray R, in Intersection I) {
    return Ray(I.P, reflect(R.Dir, I.N));
}

Ray refract_ray(in Ray R, in Intersection I, in float n1, in float n2) {
    return Ray(I.P, refract(normalize(R.Dir), I.N, n1/n2));
}

bool intersect_triangle(
    in Ray R, in vec3 A, in vec3 B, in vec3 C, out float t, 
    out float u, out float v, out vec3 N
) { 
   vec3 E1 = B-A;
   vec3 E2 = C-A;
         N = cross(E1,E2);
   float det = -dot(R.Dir, N);
   float invdet = 1.0/det;
   vec3 AO  = R.Origin - A;
   vec3 DAO = cross(AO, R.Dir);
   u =  dot(E2,DAO) * invdet;
   v = -dot(E1,DAO) * invdet;
   t =  dot(AO,N)   * invdet;
   return (abs(det) >= 1e-6 && t >= 0.0 && u >= 0.0 && v >= 0.0 && (u+v) <= 1.0);
}

bool triangle(in Ray R, vec3 A, vec3 B, vec3 C, inout Intersection I) {
   float t,u,v;
   vec3 N;
   if(intersect_triangle(R, A,B,C, t, u, v, N) && t < I.t) {
      I.t = t;
      I.P = R.Origin + t*R.Dir;
      I.N = N;
      return true;
   }
   return false;
}

bool segment_box_intersection(
  in vec3 q1,
  in vec3 dirinv,
  in vec3 boxmin,
  in vec3 boxmax,
  in float t 
) {  
   vec3 T1 = dirinv*(boxmin - q1);
   vec3 T2 = dirinv*(boxmax - q1);
   vec3 Tmin = min(T1,T2);
   vec3 Tmax = max(T1,T2);
   float tmin = max(max(Tmin.x, Tmin.y),Tmin.z);
   float tmax = min(min(Tmax.x, Tmax.y),Tmax.z);    
   return (tmax >= 0.0) && (tmin <= tmax) && (tmin <= t);
}

int stack_top = -1;
int stack_b[10];
int stack_e[10];

bool stack_empty() {
  return (stack_top < 0);
}

void stack_push(in int b, in int e) {
  stack_top++;
  stack_b[stack_top] = b;
  stack_e[stack_top] = e;  
}

void stack_pop(out int b, out int e) {
  b = stack_b[stack_top];
  e = stack_e[stack_top];
  --stack_top;
}

vec3 decode_vertex(int xyz) {
   ivec3 XYZ = (ivec3(xyz) >> ivec3(0,10,20)) & ivec3(1023); 
   return bbox_min + (bbox_max - bbox_min) * vec3(XYZ) / 1023.0;
}

vec3 min3(in vec3 p1, in vec3 p2, in vec3 p3) {
    return min(min(p1,p2),p3);
}

vec3 max3(in vec3 p1, in vec3 p2, in vec3 p3) {
    return max(max(p1,p2),p3);
}

bool mesh_AABB(in Ray R, inout Intersection I) {
    int prev_id = I.id; // index of latest intersected triangle
    bool result = false;
    vec3 invDir = vec3(1.0/R.Dir.x, 1.0/R.Dir.y, 1.0/R.Dir.z);
    stack_push(0, AABB_data_size);
    while(!stack_empty()) {
        int b,e;
        stack_pop(b,e);
        ivec3 node = get_facet(b);
        vec3 bbox_min = decode_vertex(node.x);
        vec3 bbox_max = decode_vertex(node.y);
        if(!segment_box_intersection(R.Origin, invDir, bbox_min, bbox_max, I.t)) {
            continue;
        }
        b++;
        if(node.z == -1) {
           for(int i=b; i<e; ++i) {
              if(i == prev_id) { continue; } // skip latest triangle
              ivec3 F = get_facet(i);
              vec3 p1 = decode_vertex(F.x);
              vec3 p2 = decode_vertex(F.y);
              vec3 p3 = decode_vertex(F.z);
              bool t_isect = triangle(R, p1, p2, p3, I);
              if(t_isect) { I.id = i; }
              result = result || t_isect;
          }
        } else {
          int coord = node.z & 3;
          int nb    = node.z >> 2; 
          int m     = b + nb;  
          if(R.Dir[coord] < 0.0) {
             stack_push(b,m);
             stack_push(m,e);                  
          } else {
             stack_push(m,e);
             stack_push(b,m); // positive -> process this child first                                    
          } 
        }
    }
    if(result) {
        I.N = normalize(I.N);
    }
    return result;
}  

// Modifies ray and intersection, returns total length of traversed matter.
float multi_refract(inout Ray R, inout Intersection I) {
    float result = 0.0;
    for(int i=0; i<10; ++i) {
        if(dot(R.Dir,I.N) > 0.0) { // Exiting matter
            result += I.t;
            vec3 old_dir = R.Dir;
            I.N = -I.N;
            R = refract_ray(R, I, refract_index, 1.0);
            if(R.Dir == vec3(0)) { 
               //R.Dir = reflect(old_dir, I.N); // total reflection (what I should do I think) 
               R.Dir = old_dir; // I do that instead (not correct but looks better).
            }
        } else { // Entering matter
            R = refract_ray(R, I, 1.0, refract_index);
            R.Dir = normalize(R.Dir); // Needs to be unit, so that on exit, I.t is distance
        }
        I.t = FARAWAY;
        if(!mesh_AABB(R, I)) { break; }  
    }
    return result;
}

vec3 sky(in Ray R) {
#ifdef WHITE_BACKGROUND
   return vec3(1);
#else
   return vec3(textureLod(iChannel1, R.Dir, 0.0));
#endif    
}

void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
   float alpha = iTime + iMouse.x/100.0;
   float c = cos(alpha);
   float s = sin(alpha);
   Camera C = camera(
       vec3(20.0*c, 20.0*s, 1.5),
       vec3(0.0, 0.0, 0.0),
       30.0       
   );
   Ray R = launch(C, fragCoord);
   Intersection I = intersection();
   mesh_AABB(R, I);

   if(I.t == FARAWAY) {
      fragColor.xyz = sky(R); 
    } else { 
      fragColor.xyz = vec3(0); 

      float fresnel = 1.0 + dot(R.Dir,I.N) / length(R.Dir);
      fresnel = clamp(fresnel, 0.0, 1.0); 
      fragColor.xyz += reflect_coeff * fresnel * sky(reflect_ray(R,I)); 

      float l = multi_refract(R,I);
      float d = exp(-l * extinction);
      fragColor.xyz += mix(core_color, sky(R), d);
    }
}

